import React from 'react';
import './CategoryButtons.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faUser, 
  faSeedling, 
  faBabyCarriage, 
  faBaby, 
  faBrain, 
  faChild, 
  faHome
} from '@fortawesome/free-solid-svg-icons';

const CategoryButtons = () => {
  const categories = [
    { icon: faUser, text: 'Зачатие' },
    { icon: faSeedling, text: 'ЭКО - мама' },
    { icon: faBabyCarriage, text: 'Благополучная беременность' },
    { icon: faBaby, text: 'Здоровье новорожденных' },
    { icon: faBrain, text: 'Воспитание, психология' },
    { icon: faChild, text: 'Дети от шести и старше' },
    { icon: faHome, text: 'Семейные проблемы' }
  ];

  return (
    <div className="category-buttons">
      {categories.map((category, index) => (
        <button key={index} className="category-btn">
          <FontAwesomeIcon icon={category.icon} />
          {category.text}
        </button>
      ))}
    </div>
  );
};

export default CategoryButtons;
